import React, { useEffect } from "react";
import DG from "2gis-maps";

export default function Test() {
 
  useEffect(()=>{

    let map;
    map=DG.map('map-container',{
      center:[55.31,25.23],
      zoom:5
    });

    const icon = DG.icon({
      iconUrl:'https://www.google.com/imgres?imgurl=https%3A%2F%2Fcdn.vectorstock.com%2Fi%2F1000v%2F51%2F75%2Fcar-top-view-vector-11835175.jpg&tbnid=rSFHOMdIwOPssM&vet=12ahUKEwjbwcK6waCFAxWxKBAIHfO8AZUQMygKegQIARBh..i&imgrefurl=https%3A%2F%2Fwww.vectorstock.com%2Froyalty-free-vector%2Fcar-top-view-vector-11835175&docid=w5Dflxpn1kTRJM&w=1000&h=1080&q=car%20from%20top&ved=2ahUKEwjbwcK6waCFAxWxKBAIHfO8AZUQMygKegQIARBh',
      iconSize:[30,30]
    });

    DG.marker([55.31,25.23],{icon:icon}).addTo(map).bindPopup('open')
  },[])


  return (
    <div id="map-container" style={{width:'100',height:'500px'}}>
        
    </div>
  );
}
